Now we've got a WIT file, let's create a WebAssembly library implementing the hello-world.wai interface. The wai-bindgen library uses some macros to generate some glue code for our WIT file, so add it as a dependency. $ cargo add wai-bindgen-rust Towards the top of your src/lib.rs, we want to tell wai-bindgen that this crate exports our hello-world.wai file. // src/lib.rs wai_bindgen_rust::export!("hello-world.wai"); (note: hello-world.wai is relative to the crate's root - the folder containing your Cargo.toml file) Now let's run cargo check to see what compile errors it shows. $ cargo check
error[E0412]: cannot find type `HelloWorld` in module `super` --> src/lib.rs:1:1 |
1 | wai_bindgen_rust::export!("hello-world.wai"); | ^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^ not found in `super` | This seems to fail because of something inside the wai_bindgen_rust::export!() macro, but we can't see what it is. The cargo expand tool can be really useful in situations like these because it will expand all macros and print out the generated code. To use cargo expand, you'll need to make sure it's installed (cargo install cargo-expand) and that you have the nightly toolchain available (rustup toolchain install nightly). $ cargo expand
mod hello_world { #[export_name = "add"] unsafe extern "C" fn __wai_bindgen_hello_world_add(arg0: i32, arg1: i32) -> i32 { let result = <super::HelloWorld as HelloWorld>::add(arg0 as u32, arg1 as u32); wai_bindgen_rust::rt::as_i32(result) } pub trait HelloWorld { /// Add two numbers fn add(a: u32, b: u32) -> u32; }
} There's a lot going on in that code, and most of it isn't relevant to you, but there are a couple of things I'd like to point out: A hello_world module was generated (the name comes from hello-world.wai) A HelloWorld trait was defined with an add() method that matches add() from hello-world.wai (note: HelloWorld is hello-world in PascalCase) The __wai_bindgen_hello_world_add() shim expects a HelloWorld type to be defined in the parent module (that's the super:: bit), and that super::HelloWorld type must implement the HelloWorld trait From assumption 3, we know that the generated code expects us to define a HelloWorld type. We've only got 1 line of code at the moment, so it shouldn't be surprising to see our code doesn't compile (yet). We can fix that by defining a HelloWorld type in lib.rs. Adding two numbers doesn't require any state, so we'll just use a unit struct. pub struct HelloWorld; Looking back at assumption 3, our code still shouldn't compile because we haven't implemented the HelloWorld trait for our HelloWorld struct yet. $ cargo check
error[E0277]: the trait bound `HelloWorld: hello_world::HelloWorld` is not satisfied --> src/lib.rs:1:1 |
1 | wai_bindgen_rust::export!("hello-world.wai"); | ^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^ the trait `hello_world::HelloWorld` is not implemented for `HelloWorld` The fix is pretty trivial. impl hello_world::HelloWorld for HelloWorld { fn add(a: u32, b: u32) -> u32 { a + b }
} If the naming gets a bit confusing (that's a lot of variations on hello-world!) try to think back to that output from cargo expand. The key thing to remember is the HelloWorld type is defined at the root of our crate, but the HelloWorld trait is inside a hello_world module. Believe it or not, but we're done writing code for now. Your crate should now compile 🙂

