Now let us define our WIT file for our interface. //geometry.wai /// A point coordinate structure with { x, y }
record point { x: float32, y: float32
} Note: As you use cargo expand, the generated file won't contain the Point Geometry 🙁 #![feature(prelude_import)]
#[prelude_import]
use std::prelude::rust_2021::*;
#[macro_use]
extern crate std;
#[allow(clippy::all)]
mod geometry {} This happens because we didn't use our Point geometry in any function/interface so it is not compiled to an underlying struct for Rust. So now let's use our Point geometry in a function. // geometry.wai /// A point coordinate structure with { x, y }
record point { x: float32, y: float32
} /// Calculate distance between two points
distance-between: func(p1: point, p2: point) -> float32 cargo expand #![feature(prelude_import)]
#[prelude_import]
use std::prelude::rust_2021::*;
#[macro_use]
extern crate std;
use crate::geometry::{Circle, MultiLine, Point};
#[allow(clippy::all)]
mod geometry { /// A point coordinate structure with { x, y } #[repr(C)] pub struct Point { pub x: f32, pub y: f32, } #[automatically_derived] impl ::core::marker::Copy for Point {} #[automatically_derived] impl ::core::clone::Clone for Point { #[inline] fn clone(&self) -> Point { let _: ::core::clone::AssertParamIsClone<f32>; *self } } impl core::fmt::Debug for Point { fn fmt(&self, f: &mut core::fmt::Formatter<'_>) -> core::fmt::Result { f.debug_struct("Point").field("x", &self.x).field("y", &self.y).finish() } } #[export_name = "distance-between"] unsafe extern "C" fn __wai_bindgen_geometry_distance_between( arg0: f32, arg1: f32, arg2: f32, arg3: f32, ) -> f32 { let result = <super::Geometry as Geometry>::distance_between( Point { x: arg0, y: arg1 }, Point { x: arg2, y: arg3 }, ); wai_bindgen_rust::rt::as_f32(result) } pub trait Geometry { /// Calculate distance between two points fn distance_between(p1: Point, p2: Point) -> f32; }
} Here, we see that our Point struct can be seen distance_between function is present and is exported as an external variable for use in our Rust file. We also see the Debug trait being implemented for the Point record. This file has a record and a function. The record is a structure for a point in a coordinate system (x,y) . The function performs the distance calculation between two points as arguements.

