As we saw, the use of simpler identifiers to create a Point record. we can further extend this functionality using records or other valid WAI types to specify the record arguments to create more complex and nested records . ⚠️ Recursive types are explicitly forbidden in WAI. record tree-node { children: list<tree-node>
} 👆🏼, is not allowed. Let's futher explain Nested Records this with an example: WAI file with nested records : /// A line geometry to represent a line segment with starting and ending point
record line-segment { start: point, end: point
} /// A structure to represent a circle with center point and a radius
record circle { center: point, radius: float32
} /// Arbitary shape - represent a shape with n number of points using a list of points
record multi-line{ points: list<point>,
} /// Calculate the perimeter of a Circle using 2*π*r.
perimeter-of-circle: func(c: circle) -> float32 /// Calculate the area of a Circle using π*r*r.
area-of-circle: func(c: circle) -> float32 /// Calculate the length of the multi-line by iterating over all the points and adding the result
multi-line-length: func(l: multi-line) -> float32 Here we used the point struct that we created earlier to futher define records (i.e. line-segment, circle and shape). line segment uses points to define starting and ending of the line Circle uses the point record for defining a center An Arbitrary shape can also be represented as a list of points If we had x,y for representing points in each of these geometries it would have no structure and code readability. Thus, we define nested records using a previously existing record. Note📝 Records can further have type identifiers such as u8, u16, float32, enum, tuple, etc.

