A variant lets you express something that is one of a set of types. This is similar to an enum, except each variant may have some associated data. variant error { file-not-found(string), parse(parse-failed), other,
} record parse-failed { message: string, line-number: u32,
} Variants are implemented very differently based on what is idiomatic for a particular language. In Rust, a variant is just a normal enum. In TypeScript, the variant is implemented as a tagged union. type error = { type: "file-not-found", value: string } | { type: "parse", value: ParseFailed } | { type: "other" }; For a more details, consult the Item: variant section in the *.wai format.

